Last week LSE UCU published a report called ["The Crisis of Academic Casualisation at LSE"](https://lseucu.com/wp-content/uploads/2023/03/The-Crisis-of-Academic-Casualisation-at-LSE_-2023-LSE-UCU-Report.pdf). I would recommend taking a look. They summarise their main findings in a [twitter thread](https://twitter.com/LSE_UCU/status/1641027157630623746) too. It is a damning indictment of LSE and its purported aims as a so called higher education institution. Take a look at one of the highlights:

![](staff_breakdown2.gif){fig-align="center" width="60%" height="60%"}

In truth, it makes you ashamed to be associated with such a racket. LSE have created precarity for staff. LSE increase the intake of domestic and international students and gladly take their money. LSE MSc courses are ridiculously priced and sometimes very similar courses have massive price differentials solely due to names. LSE have money to spend on buildings named after benefactors but they can't help build the careers of fixed-term staff. Don't get me started on the fact that they named a building after Paul Marshall (yes the GB news investor and leave campaign funder). Recently, [LSE unilaterally disaffiliated from Stonewall](https://thetab.com/uk/london/2023/01/19/students-deeply-disappointed-by-lse-cutting-ties-with-lgbtq-charity-stonewall-49231) without any prior consultation or decent explanation to students and staff. LSE (like many universities) is an institution that serves power and pays lip service to the interests of staff and students. There is much more to say here[^1] but I'll move on to the topic at hand.

[^1]: At this point you might ask "why do you even go there if its so bad?". Fair but a post for another time.

In response to LSE UCU's casualisation report I saw a few people saying **they'd like to see similar analysis for their institution**. LSE UCU also encouraged others to make use of their code to conduct similar analysis. So I thought why not try and do similar analysis for *every* institution? It could be useful and I like a challenge.

I'd like to stress that all of what follows builds on [analysis from Marion Lieutaud (2023) and LSE UCU members](https://github.com/MarionLieutaud/LSEUCU-casualisation). Lieutaud drew on HESA (Higher Education Statistics Authority) data for much the analysis. The heavy of lifting of getting the data in a good format was basically already done by Lieutaud. All I've done is taken that data and shoved it in some charts so you can (hopefully) see *every institution*.

::: {.callout-caution collapse="true"}
## Caveats

It is tricky enough to do this sort of thing for one institution. I have no doubt that the data quality and caveats vary across institutions. Before proceeding I wanted to caveat a few things:

-   I could have made a mistake - either in my replication of the analysis or the charts I've made below. You can take a look at my code [here](https://github.com/yusufimaadkhan/LSEUCU-casualisation-YIK), for this blog post [here](https://github.com/yusufimaadkhan/YK_Website/tree/master/posts), or you can click the button on the top right of this page to view code.

-   Data available from HESA starts at 2014/15

-   I cannot replicate all analysis of the original report because some of it uses non HESA data (e.g. LSE internal surveys and HR data)

-   Some universities have missing data and in *some* instances there are good explanations for this (e.g. the recent founding of the New College of Humanities). I have not interpolated missing observations

-   I have noticed some issues with the HESA data (e.g. SOAS being called something different one year) and have fixed where I've spotted. There are some I haven't fixed yet e.g. City University and St. Andrews have slightly different names. I'll see if I can fix these at some point[^2]. There could likely be more errors but hey verification and validation should be one of the tasks of...the Higher Education Statistics Authority no? Not a random grad student...

-   I am a wally and didn't use UKPRN codes to match institutions. Apologies. Rookie mistake on my part.

-   The structure and conditions of university contracts/funding may obscure the extent of casualisation e.g. [UCL classifying research posts as permanent but really they're open ended and dependent on future grant flows](https://twitter.com/PaulCinnam0n/status/1526505700901457923?s=20)

-   Where possible I have replicated Lieutaud's excellent charts but just added a dropdown so you can compare other HEIs. This also allowed me to eyeball whether I'd messed any of the analysis up compared to the original report.

-   I've added a dashed line for the mean of the Russell Group. A group of 24 universities that take a large share of funding, grant a majority of PhDs, and are all about research eXceLleNcE

-   When I've omitted a comparator university on the chart that appeared in the report, its because of visibility and I couldn't get the blasted label out of the way in Observable. This was a pragmatic choice. Sorry.
:::

[^2]: I fixed these issues on 11/04/2023 for City , St. Andrews, Queen's Belfast, and Newcastle. There may still be others?


::: {.cell}

:::


