## Annex: An attempt to view pressures across the sector

I added this extra chart on 10/04/2023. It is a bit dense, but I was attempting to view pressures across the sector by looking at:

-   The student to permanent staff ratio (x axis)
-   \% of fixed-term staff (y axis)
-   Total number of students (size of â—¯ )
-   Broken down by Russell Group/wider sector
-   Disaggregated for institution (individual â—¯ )

All between 2014/15 - 2021/22. It would be great if we could go back a few more years to see the proper effect of lifting the student number cap.

I thought this chart might help explore and explain where the pressures lie in the sector. A movement to the **northeast** would *suggest* increased pressure in the sector as the student to permanent staff ratio increases (X) and more fixed-term staff are brought in (Y).

Whilst its dense, lets focus on the Russell Group for a second. The boom in student numbers (size of â—¯ ) is accompanied by increases in the student to permanent staff ratio. But there is a much more dramatic pivot to fixed-term staff - especially for LSE, KCL, and QMUL.

Next, lets focus on the wider sector. Student numbers have also boomed. The % of staff that are fixed-term has also increased, but what is more dramatic is the increase in the student to permanent staff ratio.

So the Russell Group can respond to the crisis of higher education by pumping up fixed term contracts (especially if domestic and international student numbers have increased), but the wider sector faces greater pressure from student numbers on permanent staff.

So my rough interpretation is something like, Russell Group use improved financial position, "prestige" attraction, and cash flow from booming student numbers (domestic but especially international) to keep pressures at bay. But the rest of the sector can do this to a lesser extent and feels the direct pressure of increased student numbers hitting the student to permanent staff ratio.

